import { Link } from "react-router-dom";

export default function Header() {
  return (
    <header className="header">
      <Link to="/" className="logo">Catálogo de Filmes</Link>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/novo">Adicionar Filme</Link>
      </nav>
    </header>
  );
}
